--SELECT "TrainsUK2_1"."Calculation_6080608165132814" AS "Calculation_6080608165132814",   "TrainsUK2_1"."Operator" AS "Operator",   "TrainsUK2_1"."c_Origin Time (GBTT) (copy)" AS "c_Origin Time (GBTT) (copy)" FROM "TrainsUK2_1" WHERE (("TrainsUK2_1"."Operator" = 'HY') AND (TABLEAU.NORMALIZE_DATETIME("TrainsUK2_1"."Date") >= cast('2014-04-01' as DATE)) AND (TABLEAU.NORMALIZE_DATETIME("TrainsUK2_1"."Date") <= cast('2015-05-30' as DATE)) AND (NOT (((1 + CAST(TRUNC(DATE_PART('DOW', TABLEAU.NORMALIZE_DATETIME("TrainsUK2_1"."Date"))) AS BIGINT)) IN (1, 7)) OR ((1 + CAST(TRUNC(DATE_PART('DOW', TABLEAU.NORMALIZE_DATETIME("TrainsUK2_1"."Date"))) AS BIGINT)) IS NULL))) AND ("TrainsUK2_1"."Calculation_4220604162631191" IN ('1W - London Waterloo to Weymouth', '1W - Weymouth to London Waterloo')) AND (TABLEAU.NORMALIZE_DATETIME("TrainsUK2_1"."Date (group)") = cast('2015-05-29' as DATE))) GROUP BY 1,   2,   3;
